attempts.cypher:
MATCH (p:Pod)-[:BelongsTo]->(n:Namespace)
WHERE n.metadata.name = 'storefront'
  AND NOT EXISTS { MATCH (:ReplicaSet)-[:Manages]->(p) }
  AND NOT EXISTS { MATCH (:DaemonSet)-[:Manages]->(p) }
  AND NOT EXISTS { MATCH (:StatefulSet)-[:Manages]->(p) }
  AND NOT EXISTS { MATCH (:Job)-[:Manages]->(p) }
RETURN p.metadata.name AS pod_name

